N,A,B,C = IL()
L = ILs(N)

def make_take(T,x,b):
  n = len(T)
  Tdic = DD(int)
  for t in T:
    Tdic[t] += 1
  if n == 0:
    return INF,T
  choose = 0
  number = 0
  for i in range(n):
    if (b>>i)&1 == 1:
      Tdic[T[i]] -= 1
      choose += T[i]
      number += 1
  MP = abs(choose-x)+(number-1)*10
  T = []
  for k,v in Tdic.items():
    T.extend([k]*v)
  return MP,T

MIN = INF
n1 = len(L)
for b1 in range(1,1<<n1):
  MP1,L1 = make_take(L,A,b1)
  n2 = len(L1)
  for b2 in range(1,1<<n2):
    MP2,L2 = make_take(L1,B,b2)
    n3 = len(L2)
    for b3 in range(1,1<<n3):
      MP3,L3 = make_take(L2,C,b3)
      MIN = min(MIN,MP1+MP2+MP3)
